import data from "../Components/images/data1.jpeg";
import python from "../Components/images/Python.jpeg";
import { Button } from "antd";

export const MenuList=[
    {
        name: "     Python",
        image: python,
        price: <Button htmlType="Submit" type>Enroll</Button>,
    },  {
        name: "Data Visualisation",
        image: data,
        price: <Button htmlType="Submit">Enroll</Button>,
    }
]
